import { Link } from 'react-router-dom';
function Header(){
    return (
        <div className='navbar '>
            <Link to="/" className='nav-item active'>Home</Link>
            <Link to="/about" className='nav-it'>About</Link>
            <Link to="/services">Services</Link>
        </div>
    )
}
export default Header;
